Huge shoutout to @msuwaketeam for having us out in Michigan this weekend! 

@alysssa.williams took 3rd place in beginner cable and 2nd in Women’s open on boat. 
@sam77spindler took 1st place in Men’s intermediate on boat. 
@windsor.williams took 3rd place in Women’s open on boat. 
Freshman @nick_.hoskins took 2nd in men’s intermediate on boat in his first comp ever!
@veji.8 took 3rd place in alumni boat. 

Congratulations to all of our riders that came out this weekend to compete! This was a great first comp of the year and we can’t wait to be back out next year!

Shoutout to our sponsors @ronixwakeboards @donjoystore @orthosportaz @awsboats for making all of this possible! 
#wakedevils #wakeboarding #msuwake #louhas

